import React from "react";
function Experience() {
  const experiences = [
    {
      year: "2024",
      job: "Senior Attorney",
      description: "Led multiple high-profile corporate cases and provided strategic legal advice."
    },
    {
      year: "2020",
      job: "Legal Advisor",
      description: "Advised government agencies on legislative reforms and policy drafting."
    },
    {
      year: "2016",
      job: "Corporate Lawyer",
      description: "Managed corporate mergers and acquisitions with a focus on compliance."
    },
    {
      year: "2012",
      job: "Civil Litigator",
      description: "Represented clients in complex civil disputes, achieving favorable outcomes."
    },
    {
      year: "2008",
      job: "Law Clerk",
      description: "Assisted senior attorneys in research and drafting of legal documents."
    },
    {
      year: "2005",
      job: "Intern",
      description: "Provided administrative support and gained exposure to courtroom proceedings."
    }
  ];

  return (
    <div className="experience-page">
      <h2>Professional Experience</h2>
      <div className="experience-list">
        {experiences.map((exp, index) => (
          <div key={index} className="experience-box">
            <div className="experience-year">{exp.year}</div>
            <div className="experience-details">
              <h3>{exp.job}</h3>
              <p>{exp.description}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}


export default Experience;
